INSERT INTO `block_locales` VALUES ('31', 'vi', ' BlueStar', null, 'CÁC DÒNG SẢN PHẨM CHÍNH\r\n1. Các loại bếp gas dân dụng: bếp gas du lịch và gia đình\r\n2. Các loại máy hút khói\r\n3. Vỉ nướng , bếp điện các loại, nồi cơm điện, nồi áp suất, bình thuỷ điện, bộ nồi inox, nồi nhôm, chảo,...\r\n4. Các thiết bị sử dụng gas gồm : Gas lon, dây gas, valve, …\r\n', null, null);
INSERT INTO `block_locales` VALUES ('32', 'vi', 'Sharp', null, 'Sau 5 năm hoạt động trên thị trường, thương hiệu TAKA đã trở thành một trong những thương hiệu tiên phong trong lĩnh vực sản xuất và phân phối thiết bị nhà bếp cao cấp với sản phẩm bếp gas âm, bếp gas dương, máy hút mùi và đồ gia dụng. Với nỗ lực không ngừng nghiên cứu và phát triển, sản phẩm mang thương hiệu TAKA đã cung cấp các giải pháp tổng thể về  thiết bị nhà bếp, sản phẩm đa dạng về mẫu mã, kiểu dáng, tiết kiệm nhiệt năng và bảo vệ môi trường đáp ứng được nhu cầu ngày càng cao của thị trường', null, null);
