DROP TRIGGER IF EXISTS `before_insert_blocks`;
DELIMITER ;;
CREATE TRIGGER `before_insert_blocks` BEFORE INSERT ON `blocks` FOR EACH ROW SET 
	new.created = UNIX_TIMESTAMP(),
	new.updated = UNIX_TIMESTAMP()
;;
DELIMITER ;
DROP TRIGGER IF EXISTS `before_update_blocks`;
DELIMITER ;;
CREATE TRIGGER `before_update_blocks` BEFORE UPDATE ON `blocks` FOR EACH ROW BEGIN 
  IF old.active = 0 THEN
		SET new.created = UNIX_TIMESTAMP();
	END IF;
  SET new.updated = UNIX_TIMESTAMP();
END
;;
DELIMITER ;
